import React, { useEffect, useState } from "react";
import "./styles/biggestWinsLosses.css";

const BiggestWinsLosses = ({ recentTrades }) => {
  const [profitTrades, setProfitTrades] = useState([]);

  useEffect(() => {
    console.log("Recent trades:", recentTrades); // Log recent trades to check data availability
    if (recentTrades && recentTrades.length > 0) {
      // Filter trades that have exit prices
      const tradesWithExitPrices = recentTrades.filter(
        (trade) => trade.exitPrice
      );

      // Calculate profit for trades with exit prices
      const tradesWithProfits = tradesWithExitPrices.map((trade) => ({
        ...trade,
        profitData: calculateProfit(trade), // Log trade to see if it has correct structure
      }));

      // Sort trades by profit (descending order)
      const sortedTrades = tradesWithProfits.sort(
        (a, b) =>
          parseFloat(b.profitData.profit) - parseFloat(a.profitData.profit)
      );

      // Get the top 5 trades with the highest profits
      const top5Trades = sortedTrades.slice(0, 5);

      console.log("Top 5 trades:", top5Trades); // Log top 5 trades to verify correctness
      setProfitTrades(top5Trades);
    }
  }, [recentTrades]);

  const calculateProfit = (trade) => {
    if (trade.entryPrice && trade.exitPrice) {
      const entryPrice = parseFloat(trade.entryPrice);
      const exitPrice = parseFloat(trade.exitPrice);
      const profit = exitPrice - entryPrice;
      const profitPercent = ((profit / entryPrice) * 100).toFixed(2);
      return { profit: profit.toFixed(2), profitPercent };
    }
    return { profit: null, profitPercent: null };
  };

  return (
    <div className="wins-lost">
      <div className="card">
        <p>P/L</p>
        <p className="menu">::</p>
      </div>
      <div className="card-list">
        <ul className="cards">
          {profitTrades.map((trade, index) => (
            <li key={index} className="card-item">
              <div className="card-content">
                <p>{trade.symbol}</p>
                <p>
                  {trade.profitData ? `$${trade.profitData.profit}` : "N/A"}
                </p>
                <p>
                  {trade.profitData
                    ? `${trade.profitData.profitPercent}%`
                    : "N/A"}
                </p>
              </div>
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
};

export default BiggestWinsLosses;

